import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faPencil } from '@fortawesome/free-solid-svg-icons'

function SingleQnA(props) {
    return (
        <div className="container">
        <div className='outer'>
            <div className='middle CurvedContainer'  style={{backgroundColor:"#F1D4D4"}}>
                <div className="inner BlogBox OneCard">

                    <div className='MidText UppercaseText NonCursiveFont SmMdFont GreenFontShade'>
                        <h2 style={{fontFamily:"'Corinthia', cursive"}}>Q.</h2> {props.Ques}
                    </div>
                    <div className='MidText NonCursiveFont VySmFont GreenFontShade'>
                        {props.Ans}
                    </div>
                </div>
            </div>
        </div>

        <FontAwesomeIcon icon={faPhone} />
        </div>
    );
}

export default SingleQnA;
